import React from "react";
import Favorite from "./Favorite";

const ImageItem = (props) => {
  const { image } = props;
  return (
    <div>
      <img
        className="w-64 h-80 object-cover rounded-lg"
        src={image.urls.small}
        alt={image.alt_description}
      />
      <Favorite />
    </div>
  );
};

export default ImageItem;
